import React from "react";
import { ExpenseItem } from "./ExpenseItem";

export function ExpensesList(props) {

    let expenseContent = <p>There are no expenses.</p>

    return 
    props.items.length > 0 ? 
        expenseContent = props.items.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          /> 
        )) : expenseContent
    }
